const Error = () => {
  return (
    <section class="error">
      <div class="container">
        <div class="error__inner">
          <h1 class="error-title">Ошибка 404</h1>
          <h2 class="error-text">Страница не найдена</h2>
        </div>
      </div>
    </section>
  )
}

export default Error
